description:
Rivals - Part I

CG animation

Clara and Sarah are rivals over a guy. Clara is much taller and stronger than Sarah and have a fun time beating her. Sarah&amp;#039;s boyfriend enter the ring to help her, and pull her out of reach for Clara&amp;#039;s crushing axe kick. But the guy is terrified by Clara&amp;#039;s size, and perform a judo throw on his poor girlfriend by reflex. After getting rid of the annoying guy, Clara plays with her bellypunching fetish and punch Sarah in her gut until she&amp;#039;s weakened enough for a pin.
